import React from "react";
import "./RightBar.css";
import { Users } from "../../Data";
import Online from "../Online/Online";
import { AuthContext } from "../Context/Auth-context";



  const ProfileRightbar = () => {
    return (
      <>
        <h4 className="rightbarTitle">User Information</h4>
        <div className="rightbarInfo">
            <div className="rightbarInfoItem">
                <span className="rightbarInfoKey">City:</span>
                <span className="rightbarInfoValue">Rehovot</span>
            </div>
            <div className="rightbarInfoItem">
                <span className="rightbarInfoKey">From</span>
                <span className="rightbarInfoValue">New York</span>
            </div>
            <div className="rightbarInfoItem">
                <span className="rightbarInfoKey">Relationship</span>
                <span className="rightbarInfoValue">Single</span>
            </div>
        </div>
        <h4 className="rightbarTitle">User Friends</h4>
        <div className="rightbarFollowings">
            <div className="rightbarFollowing">
                <img src="https://media.istockphoto.com/photos/sportswoman-resting-picture-id1013455346?k=20&m=1013455346&s=612x612&w=0&h=4VJhhegc_PW2E9Ejav6DCNk1774Jymxdy-f6bGAcR6o=" alt="" className="rightbarFollowingImg"/>
                <span className="rightbarFollowingName">asas asa</span>
            </div>
            <div className="rightbarFollowing">
                <img src="https://media.istockphoto.com/photos/sportswoman-resting-picture-id1013455346?k=20&m=1013455346&s=612x612&w=0&h=4VJhhegc_PW2E9Ejav6DCNk1774Jymxdy-f6bGAcR6o=" alt="" className="rightbarFollowingImg"/>
                <span className="rightbarFollowingName">asas sas</span>
            </div>
            <div className="rightbarFollowing">
                <img src="https://media.istockphoto.com/photos/sportswoman-resting-picture-id1013455346?k=20&m=1013455346&s=612x612&w=0&h=4VJhhegc_PW2E9Ejav6DCNk1774Jymxdy-f6bGAcR6o=" alt="" className="rightbarFollowingImg"/>
                <span className="rightbarFollowingName">asas ass</span>
            </div>
            <div className="rightbarFollowing">
                <img src="https://media.istockphoto.com/photos/sportswoman-resting-picture-id1013455346?k=20&m=1013455346&s=612x612&w=0&h=4VJhhegc_PW2E9Ejav6DCNk1774Jymxdy-f6bGAcR6o=" alt="" className="rightbarFollowingImg"/>
                <span className="rightbarFollowingName">asas asas</span>
            </div>
        </div>
        <h4 className="rightBarTitle">Online Friends</h4>
          <ul className="rightBarFriendsList">
            {Users.map((user) => {
              return <Online user={user} key={user.id}/>;
            })}
          </ul>
      </>
    );
  };


export default ProfileRightbar;
